const qrcode1 = window.qrcode;

const video = document.createElement("video");
const canvasElement = document.getElementById("qr-canvas");
const canvas = canvasElement.getContext("2d");

const qrResult = document.getElementById("qr-result");
const outputData = document.getElementById("outputData");
const btnScanQR = document.getElementById("btn-scan-qr");
const ukolbox = document.getElementById("ukolbox");
ukolbox.hidden = true;

let scanning = false;

window.otazky = [
  {
    otazka: "Jakým zemím patří tyto obrysy? (po řadě s mezerami mezi zeměmi)",
    telo:
      '<img src="data:image/png;base64," /><br><img src="data:image/png;base64," /><br><img src="data:image/png;base64," />',
    odpoved: "nemecko rusko portugalsko",
    vysledek: [
      '<img src="data:image/png;base64," />',
      '<img src="data:image/png;base64," />'
    ]
  },
  {
    otazka: "Jakým zemím patří tyto obrysy? (po řadě s mezerami mezi zeměmi)",
    telo: '<img src="">',
    odpoved: "nemecko rusko portugalsko",
    vysledek: ['<img src="">', '<img src="">']
  }
];
qrcode1.callback = (res) => {
  if (res) {
    scanning = false;

    video.srcObject.getTracks().forEach((track) => {
      track.stop();
    });

    qrResult.hidden = false;
    canvasElement.hidden = true;
    btnScanQR.hidden = false;
    var splittet = res.split(" ");
    if (splittet[0] == "skupina") {
      setCookie("skupina", splittet[1], 30);
      outputData.innerText = "Skupina načtena, máte číslo " + splittet[1];
    } else if (splittet[0] == "ukol") {
      //ukol skupina cislo
      outputData.innerText = "type: ukol";
      console.log(splittet[1]);
      var skupina = getCookie("skupina");
      console.log(skupina);
      if (splittet[1] == skupina) {
        var ukol = splittet[2];
        outputData.innerText =
          "číslo skupiny: " + skupina + ", číslo úkolu " + ukol;
        ukolbox.hidden = false;
        var otazkaobj = window.otazky[ukol];
        console.log("cccm" + otazkaobj);
        ukolbox.innerHTML =
          "<h3>" +
          otazkaobj.otazka +
          "</h3><br>" +
          otazkaobj.telo +
          '<br><button onclick="window.odpovedet(' +
          skupina +
          ", " +
          ukol +
          ')">Odpovědět</button>';
      } else {
        outputData.innerText = "kód pro špatnou skupinu";
      }
    } else {
      outputData.innerText = "špatný kód";
    }
  }
};

btnScanQR.onclick = () => {
  navigator.mediaDevices
    .getUserMedia({ video: { facingMode: "environment" } })
    .then(function (stream) {
      scanning = true;
      ukolbox.hidden = true;
      qrResult.hidden = true;
      btnScanQR.hidden = true;
      canvasElement.hidden = false;
      video.setAttribute("playsinline", true); // required to tell iOS safari we don't want fullscreen
      video.srcObject = stream;
      video.play();
      tick();
      scan();
    });
};

function tick() {
  canvasElement.height = video.videoHeight;
  canvasElement.width = video.videoWidth;
  canvas.drawImage(video, 0, 0, canvasElement.width, canvasElement.height);

  scanning && requestAnimationFrame(tick);
}

function scan() {
  try {
    qrcode1.decode();
  } catch (e) {
    setTimeout(scan, 300);
  }
}
function setCookie(cname, cvalue, exdays) {
  const d = new Date();
  d.setTime(d.getTime() + exdays * 24 * 60 * 60 * 1000);
  let expires = "expires=" + d.toUTCString();
  document.cookie = cname + "=" + cvalue + ";" + expires + ";path=/";
}

function getCookie(cname) {
  let name = cname + "=";
  let decodedCookie = decodeURIComponent(document.cookie);
  let ca = decodedCookie.split(";");
  for (let i = 0; i < ca.length; i++) {
    let c = ca[i];
    while (c.charAt(0) == " ") {
      c = c.substring(1);
    }
    if (c.indexOf(name) == 0) {
      return c.substring(name.length, c.length);
    }
  }
  return "";
}

window.odpovedet = function (skupina, ukol) {
  var odpoved = window.otazky[ukol].odpoved;
  var vysledek = window.otazky[ukol].vysledek[skupina];
  var zadane = prompt("Zadej odpověď");
  if (zadane == odpoved) {
    alert("Správná odpověď, zobrazí se ti další místo.");
    ukolbox.innerHTML = vysledek;
  } else {
    alert("špatná odpověď");
  }
};
